    private void add_qActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_add_qActionPerformed
        String reg_no=q_reg_no.getText();
        String sub_code=q_sub_code.getText();
        String quiz_no=(String) q_no.getSelectedItem();
        String marks=q_marks.getText();
        
        
        if(reg_no.equals("")||sub_code.equals("")||quiz_no.equals("")||marks.equals(""))
            message.setText("You have to fill each fields!..");
        else
        {
            Marks mar=new Marks();
           // float quiz_marks=Float.parseFloat(marks);
            mar.setReg_no(reg_no);
            mar.setSubjet_code(sub_code);
            mar.setQuiz_no(quiz_no);
            mar.setMarks(marks);
            mar.addQuizMarks();
            q_reg_no.setText(null);
            q_sub_code.setText(null);
            q_marks.setText(null);
        }    
    }//GEN-LAST:event_add_qActionPerformed

